import React, { useState } from 'react';
import './style1.css';
const NavBar = ({state,updatetodo,visible}) => {
  
  return (
    <div className='todo-List'>
      
      {visible && (
        <div  className='right-navbar'>
          {/* Navbar content */}
          <ul>
            <li>{updatetodo}</li>
            <li>Link 2</li>
            <li>Link 3</li>
          </ul>
        </div>
      )}
      {/* Rest of the website style={{ marginLeft: visible ? '200px' : 0 }}*/}
      <div className='create-todo' >
        {/* <h1>Website Content</h1> */}
      </div>
    </div>
  );
};

export default NavBar;
